
File References:
- SubSpecCircular:
  - AppDelegate.h
  - AppDelegate.m
  - ViewController.h
  - ViewController.m
  - Main.storyboard:
    - Base
  - Assets.xcassets
  - LaunchScreen.storyboard:
    - Base
  - Info.plist
  - Supporting Files:
    - main.m
- Products:
  - SubSpecCircular.app
- Pods:
  - Pods-SubSpecCircular.debug.xcconfig
  - Pods-SubSpecCircular.release.xcconfig
  - Pods-SubSpecCircularTests.debug.xcconfig
  - Pods-SubSpecCircularTests.release.xcconfig
  - Pods-SubSpecCircularUITests.debug.xcconfig
  - Pods-SubSpecCircularUITests.release.xcconfig
- Frameworks:
  - libPods-SubSpecCircular.a
  - libPods-SubSpecCircularTests.a
  - libPods-SubSpecCircularUITests.a



Targets:
- SubSpecCircular:
    Build Phases:
    - "[CP] Check Pods Manifest.lock":
        Input File List Paths: []
        Input Paths:
        - "${PODS_PODFILE_DIR_PATH}/Podfile.lock"
        - "${PODS_ROOT}/Manifest.lock"
        Output File List Paths: []
        Output Paths:
        - "$(DERIVED_FILE_DIR)/Pods-SubSpecCircular-checkManifestLockResult.txt"
        Shell Path: "/bin/sh"
        Shell Script: |
          diff "${PODS_PODFILE_DIR_PATH}/Podfile.lock" "${PODS_ROOT}/Manifest.lock" > /dev/null
          if [ $? != 0 ] ; then
              # print error to STDERR
              echo "error: The sandbox is not in sync with the Podfile.lock. Run 'pod install' or update your CocoaPods installation." >&2
              exit 1
          fi
          # This output is used by Xcode 'outputs' to avoid re-running this script phase.
          echo "SUCCESS" > "${SCRIPT_OUTPUT_FILE_0}"
    - Sources:
      - ViewController.m
      - AppDelegate.m
      - main.m
    - Frameworks:
      - libPods-SubSpecCircular.a
    - Resources:
      - LaunchScreen.storyboard
      - Assets.xcassets
      - Main.storyboard
    Build Configurations:
    - Debug:
        Build Settings:
          ASSETCATALOG_COMPILER_APPICON_NAME: AppIcon
          INFOPLIST_FILE: SubSpecCircular/Info.plist
          LD_RUNPATH_SEARCH_PATHS: "$(inherited) @executable_path/Frameworks"
          PRODUCT_BUNDLE_IDENTIFIER: net.wiesnerpeter.SubSpecCircular
          PRODUCT_NAME: "$(TARGET_NAME)"
        Base Configuration: Pods-SubSpecCircular.debug.xcconfig
    - Release:
        Build Settings:
          ASSETCATALOG_COMPILER_APPICON_NAME: AppIcon
          INFOPLIST_FILE: SubSpecCircular/Info.plist
          LD_RUNPATH_SEARCH_PATHS: "$(inherited) @executable_path/Frameworks"
          PRODUCT_BUNDLE_IDENTIFIER: net.wiesnerpeter.SubSpecCircular
          PRODUCT_NAME: "$(TARGET_NAME)"
        Base Configuration: Pods-SubSpecCircular.release.xcconfig



